import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <div className="bg-primary text-white p-4">
      <h1 className="text-2xl font-bold">CourtCheck is loading...</h1>
      <p className="mt-2">If you see this message, React is working properly.</p>
      <div className="mt-4">
        <App />
      </div>
    </div>
  </React.StrictMode>
);
